<html>
<head>
<title>selectorBottom</title>
<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
<meta name="viewport" content="initial-scale=1,minimum-scale=1,maximum-scale=1,width=315,user-scalable=no">
<style>
body
{
margin : 0px;
padding : 0px;
width : 315;
max-width : 315;
overflow : hidden;
background : #DADAD9;
color : #444444;
font-size : 14px;
font-family:sans-serif;
-webkit-touch-callout : none;
-webkit-user-select : none;
-webkit-tap-highlight-color : rgba( 0, 0, 0, 0 );
-webkit-text-size-adjust : none;
}
.button
{
line-height : 36px;
margin : 6px;
color : #FFF;
background-color : #808080;
text-align : center;
width : 145px;
float : left;
font-size : 14px;
}
.disabled .button
{
color : rgba( 255, 255, 255, 0.33 );
}
.bar
{
width : 279px;
margin : 18px;
height : 10px;
border : 1px solid #BBB;
}
.cursor
{
height : 10px;
background-color : #87c032;
}
</style>
<!--inject.bridge-->
<script>
var PANEL_W = 315;
// RECEIVING MODEL CHANGE EVENTS FROM THE PARENT
function ONEVENT( message )
{
try
{
switch( message.type )
{
case "count":
document.getElementById( "actions" ).style.display = "block";
document.getElementById( "progress" ).style.display = "none";
if( message.count == 0 )
{
document.body.className = "disabled";
document.getElementById( "remove" ).innerHTML = "Remove";
}
else
{
document.body.className = "enabled";
document.getElementById( "remove" ).innerHTML = "Remove (" + message.count + ")";
}
break;
case "progress":
document.getElementById( "actions" ).style.display = "none";
document.getElementById( "progress" ).style.display = "block";
document.getElementById( "cursor" ).style.width = Math.floor( ( PANEL_W - 2 * 18 ) * message.i / message.n ) + "px";
break;
default:
///D $feedly( "[selector] ON EVENT:" + JSON.stringify( message ) );
}
}
catch( e )
{
$feedly( "[selector$bottom] ON EVENT FAILED: " + e.name + " -- " + e.message + " -- " + JSON.stringify( message ) );
}
}
window.onload = function(){
$B.core.wm.markAsReady(); 
document.getElementById( "remove" ).ontouchend = function(){
// send an app action request to the parent
$B.core.wm.postMessage( "parent",
{
type : "edit",
action : "remove"
}
);
}
document.getElementById( "cancel" ).ontouchend = function(){
// send an app action request to the parent
$B.core.wm.postMessage( "parent",
{
type : "edit",
action : "cancel"
}
);
}
};
</script>
</head>
<body>
<div id="actions">
<div id="remove" class="button" style="background-color:#a30800">Remove</div>
<div id="cancel" class="button" style="color:#FFF">Cancel</div>
</div>
<div id="progress" style="display:none">
<div id="bar" class="bar">
<div id="cursor" class="cursor"></div>
</div>
</div>
</body>
</html>
